import DarkModeToggle from "react-dark-mode-toggle";
import {useState} from 'react';

const [isDarkMode, setIsDarkMode] = useState(() => true);
export const ToggleDark = () => {
    return (
      <DarkModeToggle
        onChange={setIsDarkMode}
        checked={isDarkMode}
        size={80}
      />
    );
  };
